import React, {Component} from "react";
import axios from "axios";
import Button from 'react-bootstrap/Button';
import $ from 'jquery';
axios.defaults.withCredentials = true;
const headers = {withCredentials: true};

class Contact extends Component {
    state={
        nick: ""
    }
    signIn=()=>{
        const send_param = {
            nick: this.nickE.value,
            email: this.emailE.value,
            company: this.companyE.value,
            job: this.jobE.value
        }
        $.post('http://localhost:9090/member/insert', send_param, (returnData)=>{
            if(returnData.message){
                this.setState({
                    nick: returnData.message.nick
                });
                alert(this.state.nick + "님, 회원가입 되셨습니다.");
            }else{
                alert('회원가입 거부');
            }
        });

    }
    render(){
        return(
            <div>
                <input placeholder="Nickname" ref={ref=>this.nickE=ref} /><br/>
                <input placeholder="E-mail" ref={ref=>this.emailE=ref} /><br/>
                <input placeholder="Company" ref={ref=>this.companyE=ref}/><br/>
                <input placeholder="Job" ref={ref=>this.jobE=ref}/><br/>
                <Button variant="success" onClick={this.signIn}>가입하기</Button>
                <Button variant="warning">다시 생각해보기</Button>
            </div>
        );
    }
}

export default Contact;
